import './Projects.css';

export default function Projects() {
    return (
        <div className="intro">
            &nbsp; {/* non-breaking space */}
            <h1 className="intro_title">
            Details about scholar and personal projects
            </h1>
            <div className="vertical_space"/>
        </div>
    )
}
